import React, { Component } from "react";
import { Link } from "react-router-dom";

class Home extends Component {
    render() {
        return (
            <div className="holder">
                <div className="upper-banner">
                    haha                
                </div>
                <div className="lower-banner">
                    haha_duoi
                </div>
            </div>
        );
    }
}
export default Home;
